const CheckBox = () => {
  return (
    <div className="check-box-div">
      <label className="checkbox">
        <input type="checkbox" className="check-box" />
        Nothing to add? Check the box and keep going <span></span>
      </label>
    </div>
  )
}

export default CheckBox
